import React from "react";
import "./Navbar.css";

const Navbar = props => (

    <nav>
        <div className="nav nav-bar">


      <div></div>  {props.rightWrong}
       className="current-score">Current Score: {props.score}
        High Score: {props.highscore}

        </div>
    </nav>
)
export default Navbar;
